import './App.css';
import PageF1 from './page1/PageF1';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App bg-white dark:bg-black">
      <Router>
      <Routes>
        <Route exact path="/" Component={PageF1} />

      </Routes>
    </Router>

    </div>  
  );
}

export default App;
